(5, -1, 'Arquitecto', 172, '1', '0', 0, 0, 5, 'habbo_club', 'recycler_info', 'habboclub_2|VIP_badge', 'Hc Club cuenta con miles de cosas al unirte como, ropa exclusiva, mascotas exclusivas, permisos exclusivos, furnis exclusivos y miles de cosas mas con tu Hc Club ÚNETE!'),
(6, 91, 'Eventos Staffs', 28, '1', '1', 1, 0, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'ESTOS RARES que verÃƒÂ¡s a continuaciÃƒÂ³n, son los RARES que darÃƒÂ¡s en Concursos. Ver el CatÃƒÂ¡logo Oficial de HPlux para ver los precios de cada uno. Ã‚Â¡Suerte GM!.'),
(7, 1004, 'Pixels Club', 172, '1', '1', 1, 0, 3, 'habbo_club2', 'pets3', 'catalog_marketplace_header_en|cr_infopic1', '¡HAZTE HC! O espera.. en OnPixels el HabboClub es totalmente gratuito, pero como nos sobra bastante crédito, compramos.|¿Porqué es gratuito?|Tal siendo este un servidor retro de habbo, es lógico que los furnis/créditos e inclusive el habbo club sea gratuito para todos nuestros usuarios. Es infinito, así que no te preocupes por el día en que se te acabará, porque nunca pasará.\r\n\r\nRecuerda ir a la sala Oficial "Club HC" para disfrutar y bailes con tus amig@s, con todo los bailes HC!.|'),
