(9220, 1004, 'Novedades 2016', 1212, '1', '1', 1, 0, 2, 'nove_dades', 'pets3', 'catalog_marketplace_header_en|px_infopic3', 'Cada Año OnPixels actualiza la sección Novedades con los nuevos furnis que vayan saliendo del Hotel Oficial HabboES. En Novedades veréis las nuevas gamas de furni, en este caso del año 2016.|¡Novedades 2016!|Acá estarán todo los furnis nuevos & actualizados que Habbo Oficial saca, por tanto desde OnPixels nosotros tenemos la obligación de actualizarnos también, ¿Porque no?\r\n \r\n¡¿PORQUE NO ESTÁN TODOS?!, Básicamente los furnis nuevos sacados este año 2016, se han dispersado por el catálogo. Ahora está café futurista y navidad 2016.|'),
