INSERT INTO `cms_slider` (`id`, `title`, `image`, `story`, `longstory`, `author`, `time`) VALUES
(3, 'Nueva actualizaciÃ³n importante', '/Web/Imagenes/Me/news/promos/3.png', 'EntÃ©rate de lo que trata...', '<p>Es necesario saber que los usuarios, que le dan vida a este grandioso hotel, sepan la verdad. El d&iacute;a <strong>07/11/2016&nbsp;</strong>el hotel sufri&oacute; un ataque bajo, causando da&ntilde;os level o d&eacute;bil. Esto afect&oacute; varias cuentas administrativas del hotel, es por eso que hemos apagado nuestro servidor por unas horas para fixear la vulnerabilidad.</p> <p>Ahora, <strong>&iquest;Qui&eacute;nes fueron?</strong>, hemos investigado cada cuenta del atacante y son franceses y a parte que hablaban en ese idioma, que por ende se aprovecharon de una vulnerabilidad que ten&iacute;a nuestro sistema anterior.</p> <p>Es por eso, que <strong>de forma radical hemos cambiado nuestro sistema</strong> y hemos fixeado muchas cosas para evitar estos futuros ataques que solo causan problemas dentro del hotel. En vista que cambiamos nuestro sistema, cambiamos nuestro dise&ntilde;o, <strong>a&uacute;n seguimos conservando una cms privada.</strong></p> <p>Esto es todo.. tenga buen d&iacute;a, disculpen las molestia.</p> <p>&nbsp;</p>', 'Crixus', 1478603309);
